import { useEffect, useState } from "react";
import { useHistory } from 'react-router-dom';


function SearchResults() {

    let history = useHistory();

    const [error, setError] = useState(null);
    const [didSearchResultsLoad, setDidSearchResultsLoad] = useState(false);
    const [searchResults, setSearchResults] = useState([]);

    useEffect(() => {
        fetch("http://localhost:8080/search", {method: "GET"})
            .then(res => res.json())
            .then(
                (result) => {
                    setDidSearchResultsLoad(true);
                    setSearchResults(["load successful"]);
                },
                // Note: it's important to handle errors here
                // instead of a catch() block so that we don't swallow
                // exceptions from actual bugs in components.
                (error) => {
                    setDidSearchResultsLoad(true);
                    setError(error);
                }
            )
    }, [])

    if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!didSearchResultsLoad) {
        return <div>Loading...</div>;
      } else {
        return (<div>
            <div> {searchResults}</div>
            <div> {history.location.state} </div> 
            </div>
        );
      }

    return <div> {history.location.state} </div>


}

export default SearchResults;
